import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the "+ New Event" button to be visible and click it
    await page.waitForSelector('a.nav-link.create-btn', { timeout: 5000 });
    await page.click('a.nav-link.create-btn');

    // Wait for the create event page to load
    await page.waitForLoadState('networkidle');

    // Take a screenshot of the create event page after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_create_event_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_create_event_page.png'));

    // Extract meaningful data to verify navigation
    const pageTitle = await page.title();

    return {
      success: true,
      action: "Navigated to Create Event Page successfully",
      extractedData: { pageTitle },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
